short tsp_exit_condition_gpu()
{

#if 1
	static int breeding_cycles = 0;
	breeding_cycles ++;
	printf("breed cycle: %d\n", breeding_cycles);
	fflush(stdout);		

	if (breeding_cycles == 1000)
	{
		breeding_cycles = 0;
		return TRUE; // exit
	}
	else
	{
		return FALSE;
	}
#endif 
#if 0
	static int breeding_cycles = 0;
	static int count = 0;
	static int recuring_best = 0;

	breeding_cycles ++;
	printf("breed cycle: %d\n", breeding_cycles);
	fflush(stdout);		

	if (global_best_hw <= recuring_best)
	{
		recuring_best = global_best_hw;
		count = 0;
	}
	else
	{
		count ++;
	}

	if (count > 500)
	{
		count = 0;
		breeding_cycles = 0;
		return TRUE; // exit
	}
	else
	{
		return FALSE;
	}
#endif
}

